function BasketItem(props) {
    const { mainId, displayName, price, quantity, removeFromBasket = Function.prototype, incQuantity = Function.prototype, decQuantity = Function.prototype, } = props;
    return (
        <li className="collection-item">
            {displayName} 
            <i className="material-icons basket-quantity" onClick={() => decQuantity(mainId)}>remove</i> 
            x {quantity}
            <i className="material-icons basket-quantity" onClick={() => incQuantity(mainId)}>add</i> 
            = {price * quantity} V-Bucks
            <span className="secondary-content" onClick={() => removeFromBasket(mainId)}>
                <i className="material-icons basket-delete">clear</i>
            </span>
        </li>
    );
}
export { BasketItem };
